import React from "react";
import { LandingData } from "./landingData";
import "./../styles/landing.css";

const Home = () => {
  return (
    <div>
      <div id="root"></div>
      <div className="gallery">
        <figure className="gallery__item gallery__item--2">
          <img src="img/image-2.jpg" className="gallery__img" alt="Image 2" />
        </figure>
        <figure className="gallery__item gallery__item--3">
          <img src="img/image-3.jpg" className="gallery__img" alt="Image 3" />
        </figure>
        <figure className="gallery__item gallery__item--4">
          <img src="img/image-4.jpg" className="gallery__img" alt="Image 4" />
        </figure>
        <figure className="gallery__item gallery__item--5">
          <img src="img/image-5.jpg" className="gallery__img" alt="Image 5" />
        </figure>
        <figure className="gallery__item gallery__item--6">
          <img src="img/image-6.jpg" className="gallery__img" alt="Image 6" />
        </figure>
      </div>
    </div>
  );
};

export default Home;
